import React, { useEffect, useState } from 'react';




function Shop(){

    const [content , setContent] = useState(null)

    useEffect(()=>{

        fetch('/api/note/')
        .then(res => res.data)
        .then(data => setContent(data))
        .catch(err =>  setContent('Errore :' + err.content))

    });

    return(
        <div class="bg-slate-800">
            
            <div class="text-center py-24">
                <h1 class="text-2xl text-white  font-light">Practice 2</h1>
                
                <p class="text-white">
                    Titolo : {content?.note?.titolo} <br />
                    Contenuto : {content?.note?.contenuto}
                </p>
               
            </div>
     
        </div>
    )

}

export default Shop;
